        "Laboratório Multidisciplinar de Tecnologias Sociais desenvolve sistemas para atender demandas institucionais no campo de pesquisa, inovação e gestão":{
            "title":"Laboratório Multidisciplinar de Tecnologias Sociais desenvolve sistemas para atender demandas institucionais no campo de pesquisa, inovação e gestão",
            "description":"<p class=\"rtejustify\">A Universidade Federal do Agreste de Pernambuco, através do Laboratório Multidisciplinar de Tecnologias Sociais (LMTS), desenvolveu duas ferramentas com o objetivo de auxiliar processos realizados por nossa sede: o Submeta e Concursos UFAPE.</p><p class=\"rtejustify\">O Submeta é um sistema de submissão de projetos acadêmicos, que pode ser adotado para os diferentes propósitos de Ensino, Pesquisa, Extensão e Inovação. O sistema abrange todas as principais etapas relacionadas à submissão de projetos, permitindo o lançamento e configuração de editais, além de gerenciar a distribuição das avaliações e os pareceres técnicos dos avaliadores, como também, visualizar os projetos submetidos pelos proponentes. Em relação aos editais oferecidos para submissão de projetos em Pesquisa e Inovação, o Submeta já foi adotado pelo Programa Institucional de Bolsas de Iniciação Científica (PIBIC/PIC), pelo Programa Institucional de Bolsas de Iniciação Científica para o Ensino Médio (PIBIC-EM) e pelo Programa Institucional de Bolsas de Iniciação em Desenvolvimento Tecnológico e Inovação (PIBITI).</p><p class=\"rtejustify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"height:559px; width:700px\" /></p><p class=\"rtejustify\">O Concursos UFAPE é um sistema de gestão de concursos que visa auxiliar o processo de cadastramento de edital, inscrição de candidatos e recebimento de documentos para os processos seletivos para concursos e seleções públicas para professor do magistério superior. Vale lembrar que o referido sistema não é a única novidade da UFAPE no campo de seleções públicas, mas também é a primeira vez que a UFAPE realiza um concurso público de forma autônoma. O desenvolvimento deste sistema também contou com a participação do Setor de Tecnologia da Informação da UFAPE.</p><p class=\"rtejustify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"height:419px; width:700px\" /></p><p class=\"rtejustify\">O LMTS foi criado com foco no desenvolvimento de tecnologias sociais, organizado como uma comissão vinculada à Reitoria da Universidade. Antes da criação do Laboratório, a UFAPE utilizava o Sistema de Gerenciamento de Bolsas PIBIC da UFRPE, à qual era vinculada institucionalmente, que é desenvolvido pela Sigexpress. Com o desenvolvimento do LMTS, a Universidade ganhou autonomia e softwares próprios para contribuir com o atendimento de demandas do centro acadêmico e da comunidade local como um todo. Um claro exemplo disso, é a elaboração da plataforma digital “Vem Vacina Garanhuns” por parte do Laboratório, que em parceria com a Secretaria de Saúde da Prefeitura Municipal, desenvolveu um sistema que apoia todo o processo de vacinação dos municípios contra a COVID-19. Inaugurado no mês de março, a solução busca agilizar o agendamento e acompanhamento da vacinação pela população, permitindo a comunicação com os cidadãos do status de seu agendamento através de e-mail, WhatsApp e pelo próprio sistema.</p><p class=\"rtejustify\">É importante destacar que os sistemas produzidos pelo LMTS contam com a participação de docentes, discentes e técnicos da UFAPE, sem os quais nada disso seria possível.</p><p class=\"rtejustify\">No que concerne aos planos futuros para o progresso do LMTS e das plataformas produzidas a partir deste, o laboratório informa que o sistema Submeta continua em desenvolvimento para incorporar novas funcionalidades, como relatórios dos projetos e substituição dos discentes. Quanto à gestão de concursos, o objetivo é ampliar a possibilidade da inserção direta das notas lançadas e a verificação de títulos dos candidatos sejam calculados pelo próprio sistema, auxiliando no trabalho da banca avaliadora. Além disso, haverá a implantação de novo sistema na Escolaridade que virá contribuir na organização das listas de chamadas e na convocação de novos alunos pelo SISU 2022.</p>",
